import {Button, View, Image, StyleSheet, Text} from 'react-native'; 

const styles = StyleSheet.create({
  container: {
    marginTop:50,
    flexDirection: 'row',
    justifyContent: 'space-between'
  },
  tinyLogo: {
    width: 326,
    height: 489,
    marginHorizontal:50
  },
  text:{
      marginHorizontal:50
  }
});

class AboutMe extends Component {
  render() {
    return (
      <View style={styles.container}>
      <Image
        //pineapple
        style={styles.tinyLogo}
        source={{uri: 'https://images-na.ssl-images-amazon.com/images/I/71%2BqAJehpkL._SL1500_.jpg'}}
      />
        <Text style={styles.text}>Hi my names Sasha, and I choose to do a project like this because I we enjoy 
        watching anime, and reading manga. I tend to use a lot of databases to find new 
        things to watch and see what is currently airing. Along with this I use them to 
        find new series to read. I wanted </Text>
      </View>
    );
  }
}

export default AboutMe;
